import { Link } from 'react-router-dom';
import '../styles/RecentApplications.css'


const RecentApplications = ({ applications }) => {
  if (applications.length === 0) {
    return <div className="no-applications">No recent applications</div>;
  }

  return (
    <div className="recent-applications">
      {applications.slice(0, 3).map(application => (
        <div key={application._id} className="application-card">
          <Link to={`/properties/${application.property._id}`} className="property-info">
            <h3>{application.property.title}</h3>
            <p>{application.property.location}</p>
          </Link>
          <div className="application-status">
            <span className={`status-badge ${application.status}`}>
              {application.status}
            </span>
            <Link to={`/applications/${application._id}`} className="view-details">
              View Details
            </Link>
          </div>
        </div>
      ))}
    </div>
  );
};

export default RecentApplications;
